import Parent from './components/Parent';
import CounterColor from './components/CounterColor';
import NextImg from './components/NextImg';
import BusApi from './components/BusApi';

function App() {
  return (
    <div className="container">
      <BusApi />

      
      <NextImg >

      </NextImg>
      <hr/>
      <CounterColor>
      
      </CounterColor>
      <hr/>
      <Parent>
        <p>Hello</p>
      </Parent>
      <Parent>
        <h2>Bye bye</h2>
      </Parent>
      <Parent>
        <Counter />
      </Parent>
      <hr/>
      <FoodsApi />
      <hr/>
      <Value />
      <hr/>
      <Message txt="Hello"/>
      <Message txt="Bye"/>
      <hr/>
      <Counter />
    
    </div>
  );
}

export default App;
